import request from '@/utils/request'
// 请求 获取文章列表数据
export const getItemListApi = (params) => {
  // console.log(params)
  return request({
    url: 'v1_0/articles',
    method: 'GET',
    params,
  })
}
// 请求 获取文章详情数据
export const getArtical = (article_id) => {
  return request({
    url: `/v1_0/articles/${article_id}`,
    method: 'GET',
  })
}
